import React from "react"
import Block from "./Block"


function BuildRow(rowindex,board_row) {
    row = []
    for (let column = 0; column < 8; column++) {
        let data = {
            "column": column,
            "row": rowindex,
            "img": board_row[column].img
        }
        row.push(<Block data = {data}/>)
    }
    return row
}


function BlocksRow(props) {
    
    return (
        <tr>
            {BuildRow()}
        </tr>
    )
}

export default BlocksRow
